import { s as scheduler } from '../../_virtual/index2.js';
import './cjs/scheduler.production.min.js';
import './cjs/scheduler.development.js';
import { __exports as scheduler_production_min } from '../../_virtual/scheduler.production.min.js';
import { __exports as scheduler_development } from '../../_virtual/scheduler.development.js';

if (process.env.NODE_ENV === 'production') {
  scheduler.exports = scheduler_production_min;
} else {
  scheduler.exports = scheduler_development;
}
